Нормандская операция, или операция «Оверлорд» (от англ. overlord «повелитель, владыка») — стратегическая операция союзников по высадке войск в Нормандии (Франция), начавшаяся рано утром 6 июня 1944 года и закончившаяся 25 августа 1944 года, после чего союзники пересекли реку Сену, освободили Париж и продолжили наступление к французско-германской границе. Операция открыла Западный (или т. н. «второй») фронт в Европе во Второй мировой войне. До сих пор является крупнейшей десантной операцией в истории — в ней приняли участие более 3 миллионов человек, которые пересекли пролив Ла-Манш из Англии в Нормандию. Нормандская операция осуществлялась в два этапа: 
* Операция «Нептун» — кодовое имя начальной фазы операции «Оверлорд» — началась 6 июня 1944 года (дата также известна как «День Д»), закончилась 1 июля 1944 года. Её целью было завоевание плацдарма на континенте, которое продолжалось до 25 июля; 
* Операция «Кобра» — прорыв и наступление по территории Франции. Была осуществлена союзниками сразу после конца первой операции («Нептун»). Совместно с этим с 15 августа до начала осени американские и французские войска успешно провели Южно-французскую операцию, в качестве дополнения к Нормандской операции. Далее, осуществив эти операции, войска союзников, наступавшие с севера и юга Франции, соединились и продолжили наступление к германской границе, освободив практически всю территорию Франции. При планировании десантной операции командование союзников использовало опыт, полученный на Средиземноморском театре военных действий в ходе высадки в Северной Африке в ноябре 1942 года, высадки на Сицилии в июле 1943 года и высадки в Италии в сентябре 1943 года — которые до высадки в Нормандии были крупнейшими десантными операциями, также союзники учитывали опыт некоторых операций, проводимых ВМС США на Тихоокеанском театре военных действий. Операция была крайне засекречена. Весной 1944 года в целях безопасности было даже временно прекращено транспортное сообщение с Ирландией. Все военнослужащие, получившие приказ относительно будущей операции, переводились в лагеря на базах погрузки, где они изолировались, и им было запрещено покидать базу. Операции предшествовала крупная операция по дезинформации противника о времени и месте вторжения войск союзников в 1944 году в Нормандии (операция Fortitude), в её успехе большую роль сыграл Хуан Пужоль. Основными силами союзников, принявшими участие в операции, были армии США, Великобритании, Канады и французского движения Сопротивления.В мае и начале июня 1944 года войска союзников были сконцентрированы преимущественно в южных районах Англии возле портовых городов.Перед самой высадкой союзники перевели свои войска на военные базы, расположенные на южном побережье Англии, самой важной из которых был Портсмут. С 3 по 5 июня происходила погрузка на транспортные суда войск первого эшелона вторжения. В ночь с 5 на 6 июня десантные корабли были сосредоточены в проливе Ла-Манш перед высадкой морского десанта. Точками высадки были преимущественно пляжи Нормандии, получившие кодовые названия «Омаха», «Сорд», «Джуно», «Голд» и «Юта». Вторжение в Нормандию началось с массированного ночного парашютного десанта и высадки на планерах, воздушными атаками и обстрелом немецких береговых позиций флотом, а рано утром 6 июня началась высадка десанта с моря. Высадка производилась несколько суток, как днём, так и в ночное время. Битва за Нормандию продолжалась более двух месяцев и заключалась в основании, удержании и расширении береговых плацдармов силами союзников. Она закончилась освобождением Парижа и падением Фалезского котла в конце августа 1944 года.
